import '../App.css'; 
import React, { Component } from "react";
import axios from "axios";
import Modal from "../components/Modal";
import ModalDel from  "../components/ModalDel";
import { useNavigate } from 'react-router-dom';
import SearchBar from './Search-bar'; // Import the SearchBar component
import CourseReview from './CourseReviews';
import { 
    Table
} from "reactstrap";


function SearchResults() {

    const navigate = useNavigate();
    const handleSignInClick = () => {
        navigate('/SignIn'); // Navigate to the sign-in page
    };
    const handleLoginClick = () => {
        navigate('/Login'); // Navigate to the sign-in page
    };

    const courseReviews = [
        // Array of course reviews with their data
        { title: 'Review 1', author: 'Author 1', rating: 4.5, text: 'Lorem ipsum...' },
        { title: 'Review 2', author: 'Author 2', rating: 3.8, text: 'Lorem ipsum...' }
        // ...
    ];




    return( 


    <div className='Search_results'> 
        <header className=' black-bar'>
        <h1> Search_results page</h1>
            <div className='top-right-container'>
            <button className="sign-in-button" onClick={handleSignInClick}>Sign-In</button>
            <button className="login-button" onClick={handleLoginClick}>Login</button>
    </div>
    </header>
        <div className='search-bar-container'>
            <SearchBar/>
        </div>

        <div className='course-reviews-container'>
        {courseReviews.map((review) => (
        // Render the CourseReview component for each review
        <CourseReview review={review} />
        ))}
        </div>

        <div className="bottom-black-bar">
                <p>Footer content here</p>
        </div>

    {/* Add more content here */}
    </div>
    );

}

export default SearchResults;
